import React, { Component } from 'react'
import { showAllProject } from '../../actions/projectAction.js'
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import Project from './Project';

class AsClient extends Component {

    componentDidMount(){
        this.props.showAllProject();
    }
     componentWillReceiveProps(nextProps){
            if(nextProps.project){
                this.setState({
                     project: nextProps.project,
                     auth: nextProps.auth
                });
            }
     }

    render() {
        const { project } = this.props.project;   
        const { auth } = this.props.auth;  

        let ProjectData;

        if(project.user === auth.user){
              ProjectData = (
                           <div>
                            <Project project={project}/>
                        </div>
         )
        }
          
     

     
        return (
            <div>
                {ProjectData}
            </div>
        )
    }
}
AsClient.propTypes = {
  showAllProject: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  project: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  project: state.project
});
export default connect(mapStateToProps, {  showAllProject })(AsClient);
